        ELSE
        BEGIN
            SET estadoConsulta = 'FAIL';
            SET mensaje = 'No existe la Programacion especificada.';
        END;
        END IF;
    END;
    ELSE
    BEGIN
        SET estadoConsulta = 'FAIL';
        SET mensaje = 'No existe el Patron especificado.';
    END;
    END IF;
END ;;
